import React, { Component, useState, useEffect } from 'react';
import {
	BrowserRouter as Router,
	Route,
	Link
} from 'react-router-dom';


import './Assets/css/default.min.css';
import Header from './Components/HeaderComponent/header';
import Footer from './Components/FooterComponent/footer';
import HomePage from './Components/Pages/homePage';
import ArtPage from './Components/Pages/artPage';
import Page from './Components/Pages/Page';
import ContactPage from './Components/Pages/contactPage';






function MyRoutes() {


    const [menus, setMenus] = useState([]);

    useEffect(() => {
        fetch("https://dev.justinblayney.com/wp-json/menus/v1/menus/main-menu")
        .then(res => res.json())

        .then(json =>{
             setMenus(json.items)}
              )

        .then(json => console.log(json))

         });

    return (	
		<>
			{Object.keys(menus).map((ky, idx)=> (

			//<Route  path={menus[ky].slug} component={Page}   id={idx} key={idx} />
			<Route  path='/Page' component={Page}   id={idx} key={idx} />
		))}

		</>
    );
}




class App extends Component {
	render() {
		return(

	 <Router> 
		<div className="App">
			<Header />		

				<Route exact path='/' component={HomePage} />

				 const [menus, setMenus] = useState([]);

    useEffect(() => {
        fetch("https://dev.justinblayney.com/wp-json/menus/v1/menus/main-menu")
        .then(res => res.json())

        .then(json =>{
             setMenus(json.items)}
              )

        .then(json => console.log(json))

         });

    return (	
		<>
			{Object.keys(menus).map((ky, idx)=> (

			//<Route  path={menus[ky].slug} component={Page}   id={idx} key={idx} />
			<Route  path='/Page' component={Page}   id={idx} key={idx} />
		))}

		</>
    );
				<Route exact path='/Page' component={Page} />

			<Footer />

		 </div>
	  </Router> 

		);	
	}
}

export default App;
